function ajaxGetCountsOnLoad(id,url){if(typeof(url)!==undefined){$.ajax(url,{method:'get'}).done(function(data){if(data.guest){$('.like-div .like_form input').click(function(){$('header').find('.login-btn').click();});}else if(data.status===1){$('#btn-like-'+id).addClass('liked');}
if(data.likes>0){$('#btn-like-'+id+' span').html(data.likes);}
if(data.comments>0){$('#comments-btn-'+id+'-left span').html(data.commentsPhrase);$('#comments-btn-'+id+'-bottom span').html(((data.comments>0)?'<span class="show-phrase">Показать</span>':'')+data.commentsPhrase);}
for(social in data.shares){if(data.shares[social]>0){$('.id'+id+' .sharing-btn-div .btn.'+social).each(function(){$(this).html('<span>'+data.shares[social]+'</span>');});}}});}}

$(document).ready(function(){});function bindLikeButton(id){$('#like-div-'+id+' .like_form').submit(function(){return false;});$('#btn-like-'+id).on('click',function(){var btnLike=$(this);if(btnLike.hasClass('liked')){btnLike.siblings('.like_form').find('input.unlike').click();}else{btnLike.siblings('.like_form').find('input.like').click();}});}
function bindSocialButton(el,separator){var selectedInput=$(el),button=selectedInput.parent().siblings('.like');var action=selectedInput.parent().attr('action');$.ajax(action+(button.hasClass('liked')?separator+'unlike=1':''),{method:selectedInput.parent().attr('method'),}).done(function(data){if(data.status=='1'){if(button.hasClass('liked')){button.removeClass('liked');}else{button.addClass('liked');}
button.find('span').html(data.htmlBlock);ga('send','event','like-button','click');}});}

